sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var res=(inputs.res1);
array=res.getresp;

 
//var clientID=[]
array.forEach(function(doc){

    if(doc.rqmntcd=="REQ_067"){
       var msg=doc.rqmntstatusdesc;
       outputs.res=msg;
       //if(msg=="Requirement raised"){
       // outputs.res="Payment Pending";
       //}else if(msg=="Requirement accepted"){ 
       //}
        return;
    }
})
 //JSON.stringify()
 

 
//gs.info(JSON.stringify(clientID));
})(inputs, outputs);

